render(){

    return(
      <div className="container-scroller" id="page-content-wrapper">
         <AdminNav/>
         <div className="container-fluid content-wrapper">
            <div className="row">
            <div class="col-md-12 grid-margin">
              <div class="d-flex justify-content-between align-items-center"><div>
                <h4 class="font-weight-bold navbar-brand brand-logo">Notification Panel</h4>
                </div>
              </div>
            </div>
            <div className="col-sm-9 col-md-12 col-lg-5 mx-auto">
              <div className="card">
                <div className="card-body">
                  <p className="card-title">Top Products</p>
                  <div className="table-responsive">
                    <table className="table table-hover">
                      <thead>
                        <tr>
                          <th>User</th>
                          <th>Product</th>
                          <th>Sale</th>
                          <th>Status</th>
                        </tr>
                      </thead>
                      <tbody>
                        <tr>
                          <td>Jacob</td>
                          <td>Photoshop</td>
                          <td className="text-danger"> 28.76% <i className="ti-arrow-down"></i></td>
                          <td><label className="badge badge-danger">Pending</label></td>
                        </tr> 
                      </tbody>
                    </table>
                  </div>
                </div>
              </div>
            </div>
          </div>
        </div>
        <MainFooter/>
      </div>
    );
  }
}
export default AdminDashBody;
